import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field to be visible and focus it
    await page.waitForSelector('#eventSearchInput');
    await page.click('#eventSearchInput');

    // Take screenshot after focusing the search input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input_focused.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input_focused.png'));

    return {
      success: true,
      action: "Focused on the search input field",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field to be visible and focus it
    await page.waitForSelector('#eventSearchInput', { timeout: 5000 });
    const searchInput = await page.$('#eventSearchInput');
    await searchInput.click(); // Focus the search input

    // Take screenshot after focusing the input
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_focused_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_focused_search_input.png'));

    // Verify that the search input is focused
    const isFocused = await page.evaluate(input => document.activeElement === input, searchInput);

    return {
      success: true,
      action: "Focused on the search input field successfully",
      extractedData: { isFocused },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

